import React from 'react'

import './LinerProsentage.scss'



const LineerProsentage = ({prosentage = 80}) => {
    let num = Math.floor(prosentage/10)
    var ovals = []
    for(let i = 0; i < num; i++){
        ovals.push(<div key={`oval${i.toString()}`} className="oval-fill mx-1"/>)
    }

    if(!(ovals.length===10)){
        for(let j = 0; j <= 10-ovals.length; j++){
            ovals.push(<div key={j} className="oval mx-1"/>)
        }
    }

    let res

    if (Math.floor(prosentage/10)<=3){
        res = 'beginner'
    } if (Math.floor(prosentage/10) <= 8)

    return (
        <div className="d-flex">
            {ovals.map((e) => e)}
            <span>
                {res}
            </span>
        </div>
    )

}

export default LineerProsentage
